import React from "react";
import { AdminHeader } from "./.././NavBar/index";
import { AdminSideBar } from "./../../../components/admin";
import {
  Card,
  CardBody,
  NavItem,
  NavLink,
  Nav,
  TabContent,
  TabPane,
  Row,
  Col,
  CardHeader,
  CardFooter,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  FormGroup,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container
} from "reactstrap";
import { FaSearch } from "react-icons/fa";
import classnames from "classnames";
import { graphql } from "react-apollo";
import "./style.scss";
class AdminClassroom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.handleEmail = this.handleEmail.bind(this);
    this.handlePassword = this.handlePassword.bind(this);
    this.handleConfirmEmail = this.handleConfirmEmail.bind(this);
    this.handleConfirmPassword = this.handleConfirmPassword.bind(this);
  }
  handleEmail(e) {
    console.log(e.target.value);
  }
  handlePassword(e) {
    console.log(e.target.value);
  }
  handleConfirmEmail(e) {
    console.log(e.target.value);
  }
  handleConfirmPassword(e) {
    console.log(e.target.value);
  }
  render() {
    const { page } = this.props;
    return (
      <div>
        <AdminHeader page={page} />
        <main ref="main">
          <section>
            <Container fluid>
              <Row>
                <AdminSideBar page={page} />
                <div className="col-md-9">
                  <div className="row adminclassroom-header">
                    <div className="col-md-6 adminclassroom-header-title">
                      ZOO TOWN TASKS CLASSROOM
                    </div>
                    <div>
                      <FaSearch type="search" size={25} color={"black"} />
                      <input
                        className="ml-3 adminclassroom-header-searchbar"
                        placeholder=""
                      />
                    </div>
                  </div>
                  <div className="adminclassroom-coursestate">
                    <div className="adminclassroom-coursestate-listtitle">
                      <div>PUBLISHED COURSEWORKS</div>
                      <div>COURSEWORK STATS</div>
                      <div>CREATE A COURSEWORK</div>
                    </div>
                    <div className="adminclassroom-coursestate-list">
                      <div className="adminclassroom-coursestate-list-item">
                        <div>
                          <div>COURSEWORK NAME</div>
                          <div>User Experience</div>
                        </div>
                        <div>
                          <div>TOPIC</div>
                          <div>Design</div>
                        </div>
                        <div>
                          <div>SKILLS DEVELOPED</div>
                          <div>UX, DESIGN</div>
                        </div>
                      </div>
                      <div>
                        <div>STARTED</div>
                        <div>12</div>
                      </div>
                      <div>
                        <div>INCOMPLETE</div>
                        <div>5</div>
                      </div>
                      <div>
                        <div>COMPLETED</div>
                        <div>20</div>
                      </div>
                    </div>
                  </div>
                </div>
              </Row>
            </Container>
          </section>
        </main>
      </div>
    );
  }
}

export default AdminClassroom;
